import React, { useState } from 'react'
import ReactDOM from 'react-dom'

const App = () => {
  // tallenna napit omaan tilaansa
  const [good, setGood] = useState(0)
  const [neutral, setNeutral] = useState(0)
  const [bad, setBad] = useState(0)

  const posiMaara = 0
  const neutMaara = 0
  const negaMaara = 0


  return (
    <div>
      <Title />
      <Button onClick={setGood} text='good' />

      <Button onClick={setNeutral} text='neutral' />

      <Button onClick={setBad} text='bad' />
      <Show posi={posiMaara} neut={neutMaara} nega={negaMaara} />
    </div>
  )
}

const Title = () => {
  return (
    <h1>Give Feedback</h1>
  )


}



const Button = ({ onClick, text }) => {
  return (
    <button onClick={onClick}>
      {text}
    </button>

  )

}

const Show = (props) => {
  return (

    <div>
      <h1>Statistics</h1>
      <p>good  {props.posi}</p>
      <p>neutral {props.neut}</p>
      <p>bad {props.nega}</p>
      <p>all {props.posi + props.nega + props.neut}</p>
    </div>
  )
}


ReactDOM.render(<App />,
  document.getElementById('root')
)
